function Home(){
  return(
    <h1>Hello world</h1>
  )
}

function App() {


  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<SignUp />} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
